import { StyleSheet } from "react-native";

export default StyleSheet.create({
    body: {
        display: 'flex',
        alignItems: 'center',
        backgroundColor: '#252525',
        height: '100%',
    }, 
    title: {
        color: '#fff',
        fontSize: 24
    },
    btn:{
        display: 'flex',
        justifySelf: 'center',
        alignSelf: 'center',
        justifyContent: 'center',
        alignItems: 'center',
        borderWidth: 1,
        borderColor: '#fff',
        backgroundColor: 'rgba(255,255,255,0.2)',
        padding: 5,
        width: '25vw'
    },
    btnText:{
        color: '#fff',
    }
})
